import React from 'react';
import styled from 'styled-components';

const Nav = styled.nav`
	width: 100%;
	padding: 1rem;
	background-color: white;
`;

const NavItm = styled.li`
	list-style-type: none;
`;

const NavBar = () => {
	return (
		<Nav>
			<img alt="Logo"></img>
		</Nav>
	);
};

export default NavBar;
